import React from 'react';

const Home = (props) => {
    let Home
    if(props.name == undefined){
        Home = 
            (<div>
            'You are not logged in'
            </div>)
    }
    else{
        Home = (<div>{'hi'+ props.name +props.email}</div>)
    }
    return (
        Home
    );
};

export default Home;
